import scala.collection.mutable.ArrayBuffer

case class BirthAndDeathSystem(n: Int, m: Int, lambda: Double, _mu: Double, p: Double) {

  val mu = _mu * p
  var state = 0
  val history = ArrayBuffer.empty[List[Double]]

  var queue = 0
  val channels = ArrayBuffer.fill(n)((0.0, 0.0))

  def run(dt: Double, N: Long): Unit = {
    (1L to N).foreach(i => {
      val time = dt * i
      channels.indices.foreach(i => {
        if (channels(i)._1 == 1.0 && time - channels(i)._2 >= 1 / mu) channels(i) = (0.0, 0.0)
      })
      var canBePlaced = channels.count(_._1 == 0)
      var index = 0
      while (index < channels.length && queue > 0 && canBePlaced > 0) {
        if (channels(index) == 0) {
          channels(index) = (1.0, time)
          queue -= 1
          canBePlaced -= 1
        }
        index += 1
      }

      val isEvent = if (time % (1 / lambda) == 0) 1.0 else 0.0
      var isDeclined = 0.0
      var isAccepted = 0.0
      if (isEvent == 1) {
        if (canBePlaced > 0) {
          val freeChannel = channels.indexWhere(_._1 == 0)
          channels(freeChannel) = (1.0, time)
          canBePlaced -= 1
          isAccepted = 1.0
        }
        else {
          if (m - queue > 0) {
            queue += 1
            isAccepted = 1.0
          }
          else isDeclined = 1.0
        }
      }
      val queueVector = List.fill(queue)(1.0) ++ List.fill(m - queue)(0.0)

      state = n - canBePlaced + queue
      val stateVector = for (i <- 0 to n + m) yield if (i == state) 1.0 else 0.0

      val currentState = List(time, isEvent, isAccepted, isDeclined) ++ channels.map(_._1) ++ queueVector ++ stateVector
      history += currentState
    })
  }

  def printHistory(): Unit = {
    println("Time\tDimension")
    setDimensionsOrder()
    history.foreach(printHistoryColumn)
  }

  def setDimensionsOrder(): Unit = {
    println(s"0\tTime")
    println(s"0\tEvent")
    println(s"0\tAccepted")
    println(s"0\tDeclined")
    (1 to n).foreach(i => println(s"0\tChannel $i"))
    (1 to m).foreach(i => println(s"0\tQueue $i"))
    (0 to n + m).foreach(i => println(s"0\tState $i"))
  }

  def printHistoryColumn(col: List[Double]): Unit = {
    val time = col.head
    col.indices.foreach(index => {
      if (col(index) > 0) {
        index match {
          case 0 => println(s"$time\tTime")
          case 1 => println(s"$time\tEvent")
          case 2 => println(s"$time\tAccepted")
          case 3 => println(s"$time\tDeclined")
          case i if i > 3 && i < 4 + n => println(s"$time\tChannel ${i - 3}")
          case i if i >= 4 + n && i < 4 + n + m => println(s"$time\tQueue ${i - n - 3}")
          case i if i >= 4 + n + m => println(s"$time\tState ${i - m - n - 4}")
        }
      }
    })
  }
}
